import React, { useEffect , useState } from 'react'
import { useParams } from 'react-router-dom'    
import FetchFromApi from './Fetching/FetchFromApi' 
function ChannelDetails() {
    const id = useParams()
    const [ChannelDetails , setChannelDetails] = useState(null)
    const [videos , setVedeos] = useState(null)
    useEffect(()=> {
        console.log()
        FetchFromApi(`channels?part=snippet%2Cstatistics&id=${id.id}`).then((data)=>{
            setChannelDetails(data.data.items[0])
        })

        FetchFromApi(`search?part=snippet%2Cstatistics&id=${id.id}`).then((data)=>{
            setVedeos(data)
        })
    }, [id])
    console.log(ChannelDetails)
    console.log(videos)
    return (
        <div>ChannelDetails</div>
    )
}

export default ChannelDetails
